INSERT INTO `llx_product_temp` VALUES (1,'PANEDUC0006',1,NULL,'2012-04-17 10:25:53','2019-02-25 17:24:23',0,0,'Pan de Trigo Integral - La Garbancita Ecológica- 1 kg','<p>Pan ecológico elaborado con levadura madre y harina integral de trigo.</p><br />\r\n<p>En moldes de 1 kilo de masa. Conservar en trapos de tela, en el frigorífico. Si se opta por rebanar el pan, hacerlo el día de recogida del pedido (miércoles) y conservar las rebanadas que no se vayan a consumir inmediatamente en el congelador. Tostadas están sabrosísimas.</p>','','',NULL,4.30769,4.48,0,0,'TTC',4,0,0.5,0,1,1,1,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,2.9,'',1,0,0,0,'00001',0,NULL,0,NULL,0,0),(2,'LEGLACU0006',1,NULL,'2012-04-17 10:25:53','2019-01-02 18:37:21',0,0,'DESCATALOGADO Garbanzo pedrosillano- La cueva del niño- bolsa 1 kg','<p>Garbanzo Pedrosillano, envasado en bolsas de papel.</p>','','',NULL,3.49932522,3.64,0,0,'TTC',4,0,0,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,3.31731,'',1,0,0,0,'00002',0,NULL,0,NULL,0,0),(3,'PANEDUC0007',1,NULL,'2012-04-17 10:25:54','2018-05-14 16:28:34',0,0,'Pan de Centeno - La Garbancita Ecologica- 1 kg','<p>Pan ecológico de Centeno integral elaborado con levadura madre.</p><br />\r\n<p>En moldes de 1 kilo de masa. Conservar en trapos de tela, en el frigorífico. Si se opta por rebanar el pan, hacerlo el día de recogida del pedido (miércoles) y conservar las rebanadas que no se vayan a consumir inmediatamente en el congelador. Tostadas están sabrosísimas.</p>','','',NULL,5.11538,5.32,0,0,'TTC',4,0,0.5,0,1,1,1,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,3.5,'',1,0,0,0,'00003',0,NULL,0,NULL,0,0),(4,'LACELBU0016',1,NULL,'2012-04-17 10:25:54','2018-05-14 16:28:34',0,0,'Leche entera UHT- El Buen Pastor- caja 6 litros','<p>Leche ecológica de Cantabria.</p>','','',NULL,11.77885,12.25,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,'8410398000223',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,11.77885,'',1,0,0,0,'00004',0,NULL,0,NULL,0,0),(5,'ALGALGA0002',1,NULL,'2012-04-17 10:25:55','2019-02-25 17:22:33',0,0,'Alga espagueti de mar - Algamar- 100gr','<p>Sus formas alargadas y estrechas dan el nombre a esta exuberante alga parda, muy sabrosa y frecuente en litorales profundos y aguas agitadas. Rica en fibra, destaca su excepcional contenido en hierro y un gusto que recuerda la sepia.</p>','','',NULL,5.19231,5.4,0,0,'TTC',4,0,0.5,0,1,1,1,0,'',NULL,'8437002393106',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,3.57,'',1,0,1,1,'00005',0,NULL,0,NULL,0,2),(6,'ALGALGA0001',1,NULL,'2012-04-17 10:25:55','2019-02-22 12:49:36',0,0,'Alga kombu-Algamar- 100 gr','<p>De gran tamaño y color pardo, vive a una profundidad media de 12 m. Especialmente rica en ácido algínico, de consistencia carnosa, se usa en la cocina para dar sabor o como una verdura más. Su ácido glutámico reblandece las legumbres.</p>','','',NULL,5.19231,5.4,0,0,'TTC',4,0,0.5,0,1,1,1,0,'',NULL,'8437002393021',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,3.70188,'',1,0,1,1,'00006',0,NULL,0,NULL,0,3),(7,'GYCRINC0011',1,NULL,'2012-04-17 10:25:56','2019-02-25 17:05:11',0,0,'Galletas multicereales - Rincón del Segura- 300gr','<p>Galletas Multicereales elaboradas artesanalmente con productos de cultlivo ecológico y no contienen huevo ni azúcar. Sus ingredientes son: harina de espelta, sirope de cebada, licuado de soja, pasas, aceite de oliva, copos de avena, gofio de arroz, almendra, coco, jengibre, canela, aroma de naranja y bicarbonato sódico.</p>','','',NULL,3.22727,3.55,0,0,'TTC',10,0,0,0,1,1,1,0,'',NULL,'8436022841086',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,2.22,'',1,0,1,1,'00007',0,NULL,0,NULL,0,22),(8,'GYCRINC0010',1,NULL,'2012-04-17 10:25:56','2019-02-25 17:05:11',0,0,'Galletas algarroba - Rincón del Segura- 300gr','<p>Galletas de Algarroba elaboradas artesanalmente con productos de cultivo ecológico y no contienen huevo. Sus ingredientes son harina de trigo, harina de algarroba, licuado de soja, azúcar de caña, aceite de oliva, avellanas y bicarbonato sódico.</p>','','',NULL,2.