recho humano fundamental. Sin embargo, las autoridades políticas permiten que esté en manos de multinacionales y grandes superficies cuyo único objetivo es ganar cuanto más dinero mejor.</p>','','',NULL,5.76923,6,0,0,'TTC',4,0,0,0,1,1,1,0,'',NULL,'9788481986563',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,10.38462,'',1,0,0,0,'00157',0,NULL,0,NULL,0,0),(158,'LIBGARB0061',1,NULL,'2012-04-17 10:27:19','2018-05-14 16:28:34',0,0,'Pack EEUU ¡¡Oferta!!','<p>LA CULTURA DEL MAL. Moncho Tamames. Ed. 2010. 2005. 342 págs.</p> <p>Moncho Tamames disecciona la denigrante realidad social de los EEUU. Tanto su estilo de vida como su cultura, su sistema político y sus relaciones exteriores.</p> <p>El libro, de lectura sencilla, consta de 43 capítulos divididos en seis bloques: Los orígenes, Cultura y Sociedad, Sistema, El Presidente, EEUU en el Exterior y Alternativas a corto plazo.</p> <p>\"LA CULTURA DEL MAL\" despoja a EEUU de su halo de líder mundial, desnudando el lema \"american way of life\" (estilo de vida americano).</p> <p>SUPER SIZE ME. Morgan Spurlock. 2004.</p> <p>Una película que no deja indiferente a quien la ve. ¿Qué crees que te pasaría si durante 30 días siguieses unas sencillas reglas?. Desayunar, Comer y Cenar en un establecimiento de comida rápida (McDonald\'s). Nada de raciones grandes a no ser que te las ofrezcan y comer al menos una vez cada producto.</p> <p>Incluye extras como el spot televisivo de la película censurado en España y las entrevistas a Eric Scholosser, autor del libro \"Fast Food Nation\" y Phil Lawler, educador físico.</p> <p>DE VIAJE CON EL CHE. Gianni Miná. 2003.</p> <p>Película Documental sobre el rodaje de la película \"Diarios de Motocicleta\" del director brasileño Walter Salles. En 1952 Ernesto Guevara y su amigo Alberto Granado iniciaron un viaje a lo largo del continente Suramericano. En este largo periplo fueron testigos de las miserables condiciones de vida de los pueblos que visitaron. Este documental marcha paralelo al rodaje de la película añadiendo entrevistas con la gente que participa en ella, resaltando de entre todos el propio compañero de viaje del Che, Alberto Granado.</p> <p>¡BIENVENIDO A E.E.U.U.!. 2005.</p> <p>Es un CD multimedia. Contiene 10 temas de Chillout procedentes de África, Asia, Europa, América y España. Dos videojuegos en Flash, sencillos de jugar y relacionados con la política exterior de Bush. Y una serie de documentos, muy interesantes, en PDF concernientes a las políticas de invasiones, de donaciones, etc. de los EE.UU.</p>','','',NULL,2.88462,3,0,0,'TTC',4,0,0.5,0,1,1,1,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,2.88096,'',1,0,0,0,'00158',0,NULL,0,NULL,0,0),(159,'LIBGARB0053',1,NULL,'2012-04-17 10:27:19','2018-05-14 16:28:34',0,0,'Libro Medicamentos que nos enferman...','<p>Medicamentos que nos enferman e industrias farmacéuticas que nos convierten en pacientes. Ray Moynihan y Alan Cassels. Ed.Contrapunto. 2006. 256 págs. 19,90 .</p> <p>Producir enfermos para nuevos males creados a través de la estrategia de la alarma social y el miedo, podría ser el subtítulo de esta obra de Ray Moynihan y Alan Castels especialistas investigadores en temas relacionados con la salud y políticas farmacéuticas-. Estos autores nos muestran, desde una perspectiva crítica, cómo las industrias farmacéuticas, con un imponente poder por bandera poder concretado en su amplia participación en la bolsa, punta de lanza del mercado capitalista-, influye tanto en el ámbito médico, como en el de l@s pacientes con el objetivo de vender más de los diversos medicamentos que, o son meras réplicas de los que ya había o son la respuesta mesiánica a enfermedades que en principio no tienen por qué ser patologías.</p> <p>Más allá de lo que denominamos, Parry - experto en publicidad, marketing y relaciones públicas-, afirma que las compañías farmacéuticas a menudo congregan a los actores principales (líderes de opinión, médicos locales y grupos de pacientes) parta ayudar a definir, poner a punto y fabricar nuevas enfermedades</p>','','',NULL,19.13462,19.9,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,18.39867,'',1,0,0,0,'00159',0,NULL,0,NULL,0,0),(160,'LIBGARB0060',1,NULL,'2012-04-17 10:27:20','2018-05-14 16:28:34',0,0,'Libro Naturopatia. guia practica','<p>Dra. Judith Boice. Ed. Obelisco. 2002. 188 págs.</p> <p>La forma en que se tratan las enfermedades tiene como base el tratamiento de las personas, ese es uno de los principios básicos de la naturopatía. Aunque varias personas tengan los mismos síntomas que la medicina moderna convendría en codificar como iguales, aplicando, por tanto, un tratamiento común, desde la medicina clásica, la naturorápata, el individuo como distinto a otro ha de llevar un tratamiento diferenciado atendiendo a sus peculiaridades. Reconociendo a la persona como un todo integrado formando parte de la naturaleza.</p> <p>La naturopatía no consiste sólo en aplicar un tratamiento a las manifestaciones de la enfermedad (por ejemplo: un sarpullido), sino en buscar los orígenes de tal dolencia, analizando las causas biológicas, emocionales y sociales. La naturopatía, además, parte de la idea de que, como la naturaleza en la que estamos insert@s, (aunque a veces se nos olvide), nuestro organismo como un todo busca el equilibrio y cuando éste desaparece muestra síntomas que, por un lado, dan a conocer esa falta de armonía y, por otro, se convierten en guías para llegar a la raíz de dichas manifestaciones. Para obtener tales conclusiones se hace necesario un estudio minucioso de cuantos factores inciden en nuestro proceso vital.</p> <p>El libro que presentamos nos ofrece las pautas y principios básicos de la naturopatía, dándonos además consejos prácticos, naturales, no dañinos, para tratar diferentes dolencias desde la sencillez y la cercanía de la naturaleza. No es baladí el hecho de que la naturopatía utilice lo que la naturaleza nos da para apoyar y nutrir al organismo y, de ese modo, volver al equilibrio perdido.</p>','','',NULL,5.76923,6,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,4.32692,'',1,0,0,0,'00160',0,NULL,0,NULL,0,0),(161,'LIBGARB0055',1,NULL,'2012-04-17 10:27:20','2018-05-14 16:28:34',0,0,'Libro Los brotes y germinados caseros','<p>Dr. Soleis. Ed. Obelisco. 2003. 127 págs.</p> <p>Los brotes y germinados son alimentos de salud. Su excepcional riqueza en minerales, vitaminas, oligoelementos, enzimas y demás sustancias biológicas activas corrige un buen número de carencias provocadas por la alimentación moderna, deteriorada por los procedimientos industriales. Cualquiera puede, en su casa y por muy poco dinero, cultivar germinados. Es algo muy sencillo: sólo se necesitan semillas de buena calidad, un poco de agua y cacharros o bolsas de tela.</p> <p>¡Cree un jardín en su cocina prendiendo a cultivar brotes y germinados!</p>','','',NULL,7.93269,8.25,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,7.93269,'',1,0,0,0,'00161',0,NULL,0,NULL,0,0),(162,'ZUMDELI0015',1,NULL,'2012-04-17 10:27:21','2019-02-25 17:05:11',0,0,'Zumo de tomate -Delizum- 1litro','<p>De la marca elaboradora de zumos Delizum</p>','','',NULL,2.13636,2.35,0,0,'TTC',10,0,0,0,1,1,1,0,'',NULL,'8436029241148',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,1.67096,'',1,0,1,1,'00162',0,NULL,0,NULL,0,23),(163,'HORAIGU0014',1,NULL,'2012-04-17 10:27:21','2019-01-01 20:37:17',0,0,'DESCATALOGADO Berzas- Aiguaclara- bolsa 150 gr','<p>Berza u hoja de col, muy utilizada en Galicia. Utilizada para guisos, sopas, arroces, purés. Sabor suave. Ofrecida en manojos de unos 150 gramos.</p>','','',NULL,1.26786733,1.32,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,0.8,'',1,0,0,0,'00163',0,NULL,0,NULL,0,0),(164,'LIBGARB0041',1,NULL,'2012-04-17 10:27:21','2018-05-14 16:28:34',0,0,'Rescoldos- nº21. educacion alimentaria y consumo responsable en','<p>Revista monográfica semestral que dedica este número a la Educación Alimentaria y Consumo Responsable en la Escuela.</p><br />\r\n<p>Con artículos inéditos sobre la inseguridad alimentaria que vivimos: \"El nuevo (des)orden alimentario internacional\", \"Las Mujeres y la Comida\", etc..</p>','','',NULL,4.80769,5,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,3.60577,'',1,0,0,0,'00164',0,NULL,0,NULL,0,0),(165,'HARRINC0002',1,NULL,'2012-04-17 10:27:22','2019-02-20 16:35:10',0,0,'Harina blanca de trigo con germen - Rincón del Segura- 1kg','<p>El valor nutritivo del trigo y de los productos derivados de sus harinas, siempre han sido una fuente importante de alimento para la humanidad, ya que aportan energía, proteína, vitaminas y minerales, muy necesarios para el crecimiento sano de la población.</p>','','',NULL,2.21154,2.3,0,0,'TTC',4,0,0,0,1,1,1,0,'',NULL,'9900165000000',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,1.66156,'',1,0,1,1,'00165',1,NULL,0,NULL,0,48),(166,'CVEGUME0020',1,NULL,'2012-04-17 10:27:22','2019-02-22 11:36:13',0,0,'Remolacha roja rallada- Gumendi- bote 345 gr','','','',NULL,1.95455,2.15,0,0,'TTC',10,0,0,0,1,0,0,0,'',NULL,'8437002735388',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,1.35,'',1,0,1,1,'00166',0,NULL,0,NULL,0,0),(167,'LIBGARB0037',1,NULL,'2012-04-17 10:27:23','2018-05-14 16:28:34',0,0,'Libro ¡Cuidate compa!','<p>libro surge con la intención de informar sobre el enorme poder de la autocuración que llevamos dentro. Su autor Eneko Landaburu-, es un activista de la salud que propone abandonar la actitud pasiva frente a la salud que nos inculca el sistema sanitario Este actual muy mediatizado por la multimillonaria industria médico-farmacológica- para pasar a la acción mediante un mayor conocimiento de nuestro organismo, una mejora de nuestra alimentación y nuestros hábitos, y una utilización más respetuosa de los recursos naturales. Ya lo dijo Voltaire: La salud es una cosa demasiado importante como para dejarla en manos de los médicos. Tu vida es un regalo y aquí tienes un manual de instrucciones para su buen uso.</p>','','',NULL,16.34615,17,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,12.25962,'',1,0,0,0,'00167',0,NULL,0,NULL,0,0),(168,'LIBGARB0046',1,NULL,'2012-04-17 10:27:23','2018-05-14 16:28:34',0,0,'Libro Estimula tu inmunidad natural','<p>Estimula tu inmunidad natural. Dr. Pablo de la Iglesia. Ed. obelisco.176. Págs. 9 .</p> <p>Con la medicina natural el origen de las enfermedades está precedido necesariamente por un organismo que no está en condiciones de defenderse de los agentes patógenos; esta debilidad orgánica se fundamenta en la carencia de nutrientes y en un exceso de sustancias tóxicas en el mismo</p> <p>En los países occidentales donde, supuestamente, nuestra sobreabundante alimentación (en detrimento de la de las naciones empobrecidas) podría estar relacionada con unos mayores niveles de nutrición, la industrialización del sistema alimentario ha degenerado tanto nuestra dieta que, por ejemplo, en el transcurso que va del campo a nuestra mesa, las frutas y las verduras pierden un 90 % de vitamina C. Por otro lado, el mayor nivel de consumo de platos precocinados, aumenta nuestra ingesta de toxinas, deteriorando con ello las posibilidades de nuestro organismo para defenderse de los agentes patógenos que mencionábamos más arriba. Con los aditivos sucede exactamente lo mismo, sólo sirven para evitar el deterioro de alimentos ya muertos hace tiempo, para modificar sus sabores, olores y textura, sin embargo hay otros métodos de conservación que no implican el uso de aditivos químicos, por lo que no queda otra que apuntar al interés lucrativo de las grandes empresas químicas y alimentarias para justificar su existencia. La excesiva medicalización de las enfermedades, los alimentos genéticamente modificados son también factores importantísimos que contribuyen a mermar nuestras defensas orgánicas.</p> <p>Como hemos visto, el autor de este texto nos introduce en el daño que sobre nuestra salud tienen productos alimenticios, cosméticos etc., que están integrados en nuestra vida cotidiana, pero lo fundamental del mismo es que nos propone diversos tratamientos alternativos para la estimulación de nuestro sistema inmunitario y con ello aumentar nuestra calidad de vida.</p> <p>Finalmente, pero no menos importante, es que un problema estructural como un sistema alimentario que atenta contra nuestra salud y somete a más de la mitad de la población mundial al hambre, requiere no de respuestas individuales ensimismadas en nuestra propia salud, sino de una contestación colectiva que rompa el círculo vicioso de mercantilización del derecho de todas las personas a una alimentación sana y suficiente.</p>','','',NULL,8.65385,9,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,0,'',1,0,0,0,'00168',0,NULL,0,NULL,0,0),(169,'ALGALGA0013',1,NULL,'2012-04-17 10:27:24','2019-02-22 17:35:41',0,0,'Crema de sésamo blanco (tahina) con algas - Algamar-  320g','<p>Modo de empleo: ideal para: tostadas, ensaladas, verduras, purés, salsas, pasta, arroz, patatas, setas, endibias, tofu, seitán... Para aliñar, añadir aceite. Ingredientes: sésamo sin tostar y pelado, alga Espagueti de Mar y especias. 100% producto seco, sin agua. Contiene 40 g de algas por kilo</p>','','',NULL,7.01818,7.72,0,0,'TTC',10,0,1.4,0,1,1,1,0,'',NULL,'8437006739047',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,5.44,'',1,0,1,1,'00169',0,NULL,0,NULL,0,1),(170,'HUEECOV0001',1,NULL,'2012-04-17 10:27:24','2018-05-14 16:28:34',0,0,'Huevos ecológicos- Ecovera- media docena','<p>De los productores de Pasaron de la Vera (Extremadura), EcoVera.De gallinas que cuentan con un terreno de 2 hectáreas para moverse con libertad y una nave donde guardecerse a la noche. De gallinas de la raza \"ISA BROWN\".</p>','','',NULL,2.28216542,2.37,0,0,'TTC',4,0,0.5,0,1,0,1,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,2.16358,'',1,0,0,0,'00170',0,NULL,0,NULL,0,0),(171,'CTOEKOL0007',1,NULL,'2012-04-17 10:27:25','2018-12-30 16:47:05',0,0,'DESCATA