reparar el balcón.</p> <p>1.)El huerto al alcance de la mano.</p> <p>2.)¿Qué hay que saber?</p> <p>3.)Preparación de las macetas y las jardineras.</p> <p>4.)Qué mantillo es adecuado para las hortalizas?</p> <p>5.)¿Es necesario abonar?</p> <p>6.)¿Material necesario?</p> <p>B.- Hortalizas de balcón. Berenjena, albahaca, remolacha, zanahoria, col, cebollino, calabacín, haba, fresa, judía, lechuga, laurel, canónigo, menta, perejil, acelga, guisante, pimiento, rábano, romero, ajedrea, salvia, tomillo y tomate.</p> <p>C.- Calendario del huerto en el balcón.</p> <p>Editorial Larousse. 2010.</p> <p>143 páginas. 19,30 X 22.50 cm. en cuatricomía y pasta dura.</p>','','',NULL,9.56731,9.95,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,'2750432930533',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,9.56731,'',1,0,0,0,'00291',0,NULL,0,NULL,0,0),(292,'LIBGARB0043',1,NULL,'2012-04-17 10:29:05','2018-05-14 16:28:34',0,0,'Libro Madrid al fuego','<p>Autora: Igone Marrodán. Editorial Silex, 225 páginas.</p> <p>Recetas históricas, tradicionales y creativas. Los habitantes de Madrid han sabido adaptar e incorporar a las recetas de cocina autóctonas -celosamente mantenidas en el ámbito rural- cuantas novedades interesantes han llegado a su conocimiento. En estas páginas, no sólo se recuperan -traducidas a las medidas e instrumentos actuales para poder realizarse fácilmente- preparaciones de las cortes austriaca y borbónica y de los sabios platos del acervo cultural popular de base arábiga y federalista, sino que también se explican las elaboradas con los nuevos productos que se crían en la Comunidad, crisol abierto de muy variadas etnias, todas ellas seguidas de un breve comentario histórico que ayudará al lector a entender la peculiar idiosincrasia de los habitantes del foro y sus alrededores.</p>','','',NULL,5.76923,6,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,4.32692,'',1,0,1,0,'00292',0,NULL,0,NULL,0,0),(293,'LIBGARB0044',1,NULL,'2012-04-17 10:29:06','2018-05-14 16:28:34',0,0,'Libro Observar las aves','<p>Autor: Pierre Darmangeat. Editorial Tikal, 222 páginas</p> <p>Una información concisa pero tan completa y precisa como en las mejores enciclopedias, en un formato excepcionalmente manejable. Aprende a reconocer las aves más comunes clasificadas por su hábitat. Fichas ilustradas de cada ave con una descripción detallada, acompañada de su biología, comportamiento y distribución. Necesario para observar las aves, desde la vestimenta hasta el material, el comportamiento del observador, los grandes ejes migratorios, las mejores localizaciones etc.</p>','','',NULL,9.61538,10,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,7.21154,'',1,0,1,1,'00293',0,NULL,0,NULL,0,0),(294,'LIBGARB0023',1,NULL,'2012-04-17 10:29:06','2018-05-14 16:28:34',0,0,'Libro Rebeldes periféricas','<p>Autora: Ana Muiña. Editorial La Linterna Sorda, 210 páginas.</p> <p>Ana Muiña nos toma de la mano firmemente para reconocer y reconocernos en las mujeres protagonistas y partícipes en los movimientos políticos, sociales y sindicales del siglo XIX. Esa historia, oculta, no hablada y, menos aún, escrita, lo es por diferentes causas: por ser mujeres, por no ser voces reformistas sino revolucionarias y por ser producidas desde abajo desde la chusma. Poner nombres y apellidos a algunas, pero no a todas, es fuente de cierta impotencia, mas lograr identificar a algunas de las mujeres que se levantaron contra el sistema que ahoga y objetiva a las personas, es ingente y satisfactoria tarea, mujeres que, como la misma autora nos dice, querían la transformación de la vida cotidiana, de los sentimientos, de todas las relaciones sociales y productivas . Ya vemos, voces de mujeres ocultadas y acalladas, pero no ahogadas, ahora rescatadas de un barco que jamás llegó a hundirse muchos de los movimientos sociales actuales se nutren de sus obras y actos-. Ahora ya las empezamos a ver, ahora ya sabemos que por nuestras bocas hablan también ellas: revertir el orden existente que agota nuestra potencia de ser, necesariamente nos lleva a tomarlas de la mano.</p>','','',NULL,18.26923,19,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,14.38462,'',1,0,0,0,'00294',0,NULL,0,NULL,0,0),(295,'LIBGARB0022',1,NULL,'2012-04-17 10:29:07','2018-05-14 16:28:34',0,0,'Libro Por tu propio bien. 150 años de consejos...','<p>Autoras: Barnara Ehrenreich y Deirdre English. Editorial Capitán Swing, 432 páginas.</p> <p>La presente obra, publicada por primera vez en 1978 es un libro imprescindible. Constituye un análisis certero y exhaustivo sobre la apropiación de la salud, los saberes y los cuerpos de las mujeres por los hombres (disfrazados de expertos). Por tu propio bien es la historia de una larga y penosa expropiación, la del tratamiento de la mitad de la población mundial como anómala, de su subordinación y dominación por parte de la otra mitad y de su culpabilización por no ser como deberían ser. Realiza una investigación acerca de la formación de expertos sanitarios, médicos, psicólogos, pedagogos en su mayoría hombres- y, en paralelo, como condición, el desprecio de los saberes de las mujeres como sanadoras, matronas, educadoras, expertas botánicas, etc. pasando de ser sujetos activos de la comunidad a objetos pasivos de estudio, medicalización y tropelías varias en la naciente revolución industrial.</p>','','',NULL,24.03846,25,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,18.02885,'',1,0,0,0,'00295',0,NULL,0,NULL,0,0),(296,'LIBGARB0045',1,NULL,'2012-04-17 10:29:07','2018-05-14 16:28:34',0,0,'Libro Incendiarios de ídolos','<p>Autor: Mathieu Corman, Editorial Cambalache, 170 páginas.</p> <p>Mathieu Corman, periodista, editor y viajero belga buscaba una revolución para vivirla, para contarla, y la encontró en aquellos primeros días de octubre de 1934. Es la crónica de su viaje para entrar en Asturias; las voces de las personas que encontró a su paso y el retrato, casi fotográfico, de una tierra en llamas. Se trata de uno de los escasos testimonios, si no el único, de un periodista extranjero que vivió la experiencia en pleno desarrollo de los acontecimientos.</p>','','',NULL,12.5,13,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,9.375,'',1,0,0,0,'00296',0,NULL,0,NULL,0,0),(297,'LIBGARB0059',1,NULL,'2012-04-17 10:29:07','2018-05-14 16:28:34',0,0,'Libro Un deseo apasionado de trabajo más barato y servicial','<p>Autor: Eduardo Romero, Editorial Cambalache, 141 páginas.</p> <p>El análisis de la Ley de Extranjería y su contextualización en la historia de las migraciones en el capitalismo europeo revela el verdadero sentido de la política migratoria: instaurar el miedo y la inseguridad para la explotación de un trabajo barato y servicial imprescindible para el crecimiento de la economía española. La crisis no traerá consigo el retorno masivo de la población inmigrante, sino la intensificación de este modelo.</p>','','',NULL,8.65385,9,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,11.53846,'',1,0,0,0,'00297',0,NULL,0,NULL,0,0),(298,'LIBGARB0047',1,NULL,'2012-04-17 10:29:08','2018-05-14 16:28:34',0,0,'Libro El movimiento antiglobalización en su laberinto...','<p>Autores: Rosa Bajo, Pilar Galindo, José Manuel Hernández, Agustín Morán, Sira del Río, Gonzalo Romero, Juan Luis Ruíz Jiménez. Editorial Catarata-CAES, 217 páginas.</p> <p>Estas páginas contienen material privilegiado para conocer, desde dentro, un movimiento popular que, entre 2001 y 2003 fue capaz de impulsar la movilización social para defender los derechos y libertades de los hombres, las mujeres y los pueblos, creando cauces participativos, democráticos y anticapitalistas para minorizar, de una vez por todas, la omnipresente herencia del franquismo. Los primeros capítulos, analizan la globalización desde el punto de vista del proceso constituyente del capital como sujeto dominante de la sociedad, así como las consecuencias de este hecho sobre la vida cotidiana en sus aspectos materiales (trabajo, alimentación, etc.) e inmateriales (libertades, cultura, relaciones, valores, deseos). Se recorre la historia del movimiento, a la luz de sus condicionantes externos e internos, mostrando el proceso de su degradación a un mero instrumento de la izquierda parlamentaria. No se pretende aquí hacer méritos académicos ni demostrar los libros que hemos leído. Se trata de poner palabras a lo que hemos vivido como actores para facilitar recursos a los combatientes contra la Europa del Capital, la Globalización y la Guerra.</p>','','',NULL,11.53846,12,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,5.76923,'',1,0,0,0,'00298',0,NULL,0,NULL,0,0),(299,'LIBGARB0058',1,NULL,'2012-04-17 10:29:45','2018-05-14 16:28:34',0,0,'Libro La batalla del ramon y cajal','<p>Autores: Mercedes Mauri, Toribia Casado, J. Manuel Hernández, Agustín Morán. Editorial Kehaceres, 206 páginas.</p> <p>Este libro, escrito desde una dura experienca de lucha como trabajador@s y como ciudadan@s, está dedicado a todas las personas, (también trabajador@ y ciudadan@s) que, en la Sanidad Pública, compensan los daños producidos por empresarios y políticos privatizadores con su propia energía vital. índice: I.- El huracán neoliberal contra la Salud Pública. II.- ¿Cómo se privatiza la Sanidad Pública? III.- La batalla de la Limpieza del Hospital Ramón y Cajal en sus documentos. IV.- La batalla del Hospital Severo Ochoa. V.- Otras batallas contra la privatización de la salud: Clínica de la Concepción, Limpiadoras del Hospital Clínico y Limpiadoras de la Paz. VI.- Privatización, multinacionales y corporativismo sindical: tres aspectos de la misma realidad.</p>','','',NULL,8.65385,9,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,8.65385,'',1,0,0,0,'00299',0,NULL,0,NULL,0,0),(300,'LIBGARB0049',1,NULL,'2012-04-17 10:29:45','2018-05-14 16:28:34',0,0,'Libro Políticas postmodernas','<p>Autor: Jose María Ripalda, Editorial Catarata-CAES, 222 páginas.</p> <p>Este libro nos ofrece una radiografía en serie de un mundo en el que el economicismo de la derecha se adjudica el sello de \" revolucionario \" y el humanismo es patrimonio del Fondo Monetario Internacional y de la OTAN. El progreso, basado en la razón instrumental y la economía, es una fábrica de desigualdad y violencia. Como paliativo, las ONGs nos permiten ayudar a los necesitados de los países cuya ruina hemos planificado fríamente. La penetrante mirada del autor nos muestra una España poblada por súbditos de una Constitución autoritaria y excluyente, gobernada por políticos que, entre guardaespaldas, invocan en sus discursos a los perdedores. Se describe el nuevo Nacionalismo español del bienestar como la ideología de los sectores sociales beneficiados, nueva mayoría silenciosa que rechaza todo lo que ponga al descubierto los mecanismos de su complicidad como \"inocentes\" consumidores.</p>','','',NULL,7.69231,8,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,6.92308,'',1,0,0,0,'00300',0,NULL,0,NULL,0,0),(301,'LIBGARB0031',1,NULL,'2012-04-17 10:29:46','2018-05-14 16:28:34',0,0,'Libro Individuo y orden social','<p>Autor: Andrés Bilbao, Editorial Sequitur-CAES, 288 páginas.</p> <p>En las sociedades parlamentarias modernas las relaciones sociales están sometidas a los principios de la Economía. Esta \"sociabilidad económica\", que se identifica con la democracia, limita la libertad del individuo al ámbito de las leyes del mercado. El presente libro intenta desvelar la genealogía de un orden social que, una vez construido por los individuos se convierte, como el capullo para la oruga, en una cárcel. El hecho fundacional de este modelo, compartido por la derecha y por la izquierda, es el crecimiento económico basado en la competitividad y el progreso tecnológico. La sostenibilidad de este orden de mercado, requiere unos políticos de mercado dispuestos a construir una sociedad de mercado y un individuo de mercado. La economía global desconoce cualquier límite para la rebaja de los costes productivos. El resultado es un mundo inseguro y violento. El keynesianismo - la izquierda realmente existente - participa de este modelo, aunque añadiendo una receta para las contiendas electorales: pleno empleo y protección social como condición para el crecimiento económico. Con ello se sitúa, tanto en sus presupuestos teóricos como en sus fuentes de poder, en el campo de \"los demócratas de mercado\". El marxismo de manual, perfecto desconocedor de Marx, identifica el socialismo con la integración de la clase obrera y toda la humanidad en este progreso económico y tecnológico.</p>','','',NULL,16.34615,17,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,12.25962,'',1,0,0,0,'00301',0,NULL,0,NULL,0,0),(302,'LIBGARB0030',1,NULL,'2012-04-17 10:29:46','2018-05-14 16:28:34',0,0,'Libro La crisis de la escuela educadora','<p>Autores: Gonzalo Romero y Amparo Caballero (eds.). Editorial Laertes, 277 páginas.</p> <p>Este libro intenta reflexionar sobre una crisis dentro de otra crisis. Para pensar cuál es el lugar de la escuela con una sociedad como la que nos \"envuelve\" a educadores, familias, alumnado... Un libro que plantea una cuestión radical: ¿qué papel debería jugar la escuela en la reconstrucción de una sociedad como la nuestra? Si la escuela no sirve para repensar lo que somos (seres sociales por naturaleza) ¿para qué sirve, entonces, la escuela? ¿Por qué se rehúye esta pregunta vital para el presente y el futuro de una institución que obliga a niños y niñas entre los 6 y los 16 años de edad a acudir a ella? Un libro escrito para repensar la escuela. Para quienes aún crean que dentro de la escuela nos queda mucho por aprender y a los que, esperanzados, crean, siquiera a tientas, que la escuela puede ser, todavía hoy, un arma cargada de futuro...</p> <p>Gonzalo Romero. Profesor del Dpto. de Didáctica de la Universidad de Alcalá. Ha publicado artículos y libros sobre educación comunitaria y contextos sociales y educativos como Hacia una pedagogía del contexto y Palabras liberadas.</p> <p>Amparo Caballero. Doctora en Psicología y profesora del Dpto. de Psicología Social y metodología de la Universidad Autónoma de Madrid. Ambos autores son miembros de la Asociación Cultural \"Candela\".</p>','','',NULL,14.42308,15,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,10.81731,'',1,0,0,0,'00302',0,NULL,0,NULL,0,0),(303,'LIBGARB0050',1,NULL,'2012-04-17 10:29:47','2018-05-14 16:28:34',0,0,'Libro Fantomas contra los vampiros multinacionales','<p>Autor: Julio Cortázar. Editorial Excelsior, 77 páginas.</p> <p>El compromiso político de Cortázar, muchas veces soterrado en el realismo mágico de sus cuentos, se convierte en guía de este alegato anticapitalista que, en forma de cómic de súper-héroes, desenmascara los intereses económicos que podrían llevar a aniquilar la cultura de no parar el actual sistema neoliberal. En el mundo entero están desapareciendo las obras de los grandes escritores. Alguien las está robando, la cultura en pleno va a desaparecer si alguien no pone remedio. Cortázar pone en manos del supuesto héroe, el famoso Fantomas, la posibilidad de ejercer su poder y arreglar el asunto.</p>','','',NULL,5.76923,6,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,4.32692,'',1,0,0,0,'00303',0,NULL,0,NULL,0,0),(304,'LIBGARB0032',1,NULL,'2012-04-17 10:29:47','2018-05-14 16:28:34',0,0,'Libro Puntos negros y otros artículos','<p>Autor: José Nakens, 1841-1926, Editorial La Linterna Sorda, 288 páginas.</p> <p>Nº 1 DE LA COLECCIÓN \"LO QUE NO DEBE DECIRSE\".</p> <p>Este libro contiene una extensa recopilación de sus artículos. En el prólogo (apertura), Alfredo Grimaldos le presenta como defensor de la Primera República y precursor de la Segunda, impulso que, junto a su anticlericalismo vehemente, siguen siendo de actualidad. ... El pesebre exige sumisión a la línea editorial de los amos... A diferencia de gran parte del periodismo -comentarista de comunicados oficiales, escribiente de ruedas de prensa sin preguntas y filtrador de dossieres policiales-, Nakens mantiene el permanente contacto con la realidad que caracteriza a un periodista El supuesto pluralismo de los medios de comunicación sólo sirve para las batallas en un vaso de agua de los periodos electorales ... Frente a este periodismo de gallinas ponedoras, Nakens nos muestra, 150 años después, la bandera del periodismo crítico y social: me llevaré a la tierra virginidades, entre ellas la de no haber escrito ni una letra contra mis convicciones ni haber alquilado mi pluma para servir intereses ajenos. Por eso compadezco a los infelices galeotes de la inteligencia que no saben exigir y conservar en los periódicos dónde está la independencia que yo tuve en todos. En su introducción, Ana Muiña y Agustín Villalba (editores), subrayan la fuerza de los escritos de José Nakens a pesar del tiempo transcurrido y destacan su libertad de pensamiento y apasionado patriotismo, tan comunes en las grandes figuras republicanas de la época, aunque esa misma patria les juzgó y les condenó sin misericordia.</p>','','',NULL,14.42308,15,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,10.81731,'',1,0,0,0,'00304',0,NULL,0,NULL,0,0),(305,'LIBGARB0033',1,NULL,'2012-04-17 10:29:48','2018-05-14 16:28:34',0,0,'Libro Bilis. vómitos de tinta','<p>Autor: Luis Bonafoux, 1885-1918. Editorial La Linterna Sorda. 320 páginas.</p> <p>Nº 2 DE LA COLECCIÓN \"LO QUE NO DEBE DECIRSE\".</p> <p>Su editora, Ana Muiña, levanta la conspiración de silencio sobre uno de los escritores más lúcidos de su época. Bonafoux, creador de un estilo periodístico que denuncia una organización social injusta, criminal y abusiva, odiaba a los políticos que truecan sus opiniones por las ventajas del mando y despreciaba la venalidad de las plumas vendibles. Errico Malatesta le escribe el 21 de julio de 1907: acabo de leer con placer las pruebas de su libro y ... si usted no es anarquista, merece serlo ... por el deseo de que a las quejas y las críticas ... siga pronto la acción demoledora llamada, más pronto que tarde, a reedificar sobre las ruinas de lo que ya se tambalea. José Nakens se despidió de él con una crónica necrológica en El Motín el 7 de noviembre de 1918. Su vida fue una lucha constante contra todo lo falso, lo convencional, lo ridículo y lo injusto. Vivió modestamente, trabajó mucho a favor de los humildes y sufrió persecuciones que agigantaron su espíritu; hizo la vida de los buenos, de los justos, de los fuertes y probó las amarguras anejas a todo ser superior... Hijos de Bonafoux me asocio a vuestro duelo.</p>','','',NULL,14.42308,15,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,10.81731,'',1,0,0,0,'00305',0,NULL,0,NULL,0,0),(306,'MMACORT0006',1,NULL,'2012-04-17 10:29:48','2019-02-02 10:57:27',0,0,'Mermelada Arandanos Azucar de Caña-Valle del Taibilla- 330g','','','',NULL,3.45455,3.8,0,0,'TTC',10,0,0,0,1,1,1,0,'',NULL,'8437002491017',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,2.72617,'',1,0,1,1,'00306',0,NULL,0,NULL,0,4),(307,'MMACORT0024',1,NULL,'2012-04-17 10:29:48','2019-02-14 18:03:06',0,0,'Mermelada Frutos del Bosque Azucar de Caña-Valle del Taibilla- 330g','','','',NULL,3.45455,3.8,0,0,'TTC',10,0,0,0,1,1,1,0,'',NULL,'8437002491024',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,2.38083,'',1,0,1,1,'00307',0,NULL,0,NULL,0,9),(308,'HARRINC0008',1,NULL,'2012-04-17 10:29:49','2018-05-14 16:28:34',0,0,'Harina integral de garbanzo SIN GLUTEN- Rincón del Segura- 500gr','','','',NULL,2.45455,2.7,0,0,'TTC',10,0,0,0,1,0,0,0,'',NULL,'8436022840720',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,2.45455,'',1,0,1,1,'00308',0,NULL,0,NULL,0,0),(309,'LIBGARB0071',1,NULL,'2012-04-17 10:29:49','2018-05-14 16:28:34',0,0,'Revista Tachai- nº 27- febrero 2011','','','',NULL,1.92308,2,0,0,'TTC',4,0,0.5,0