ne aceite de manzanilla, de caléndula, de almendras, extracto de aloe vera, tintura de manzanilla, extracto de romero, esencia de azahar y azuleno.</p>','','',NULL,10.33058,12.5,0,0,'TTC',21,0,5.2,0,1,1,1,0,'',NULL,'8436542930307',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,7,'',1,0,1,1,'00360',0,NULL,0,NULL,0,2),(361,'CYLTALL0062',1,NULL,'2012-04-17 10:30:14','2019-02-25 17:05:11',0,0,'Crema manos caléndula -Amapola Biocosmetics- 50 ml','<p>Composición y Propiedades</p><br />\r\n<p>Contiene aceite de caléndula, aceite de almendras, tintura de caléndula, extracto de romero y esencia de madreselva. El extracto de caléndula es tonificante y epitelizante, especialmente indicado para pieles sensibles, agrietadas, estropeadas o con problemas de dermatitis. La glicerina es suavizante e hidratante. Forma de aplicación</p>','','',NULL,4.50413,5.45,0,0,'TTC',21,0,0,0,1,1,1,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,3.1,'',1,0,1,1,'00361',0,NULL,0,NULL,0,3),(362,'LIBGARB0002',1,NULL,'2012-04-17 10:30:14','2018-05-14 16:28:34',0,0,'Libro El huerto familiar ecológico','<p>Cultivar un huerto ecológico es algo más que obtener verduras, frutas y hortalizas de manera natural, ya que los frutos más preciados que se consiguen con su cultivo son los beneficios para la propia salud y la del entorno.</p> <p>El huerto familiar ecológico, la primera obra y la más completa sobre agricultura biológica escrita por un autor de reconocido prestigio en España, enseña todos los secretos del cultivo más sano y natural, con explicaciones e indicaciones apropiadas a nuestro clima, y profusamente ilustrada con detalladas fotografías y dibujos paso a paso.</p> <p>Técnicas de cultivo y herramientas.</p> <p>Consejos para el cuidado.</p> <p>Guía de cultivo de hortalizas, árboles frutales y plantas medicinales.</p> <p>Tratamientos naturales de plagas y enfermedades.</p> <p>El compost y la fertilización naturales.</p> <p>El calendario del agricultor.</p> <p>El verdadero libro de cabecera para todos aquellos que quieren cultivar un huerto ecológico con éxito y desean vivir en equilibrio con la naturaleza y disfrutar de plena salud.</p>','','',NULL,34.61538,36,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,31.15385,'',1,0,1,0,'00362',0,NULL,0,NULL,0,0),(363,'LIBGARB0012',1,NULL,'2012-04-17 10:30:15','2018-05-14 16:28:34',0,0,'Libro Anti cancer','<p>Esta obra es fruto de la experiencia que David Servan-Schreiber vivió hace quince años, cuando le diagnosticaron un tumor celebral. Después de someterse a los tratamientos médicos convencionales, tuvo una recaída y decidió estudiar a fondo toda la información disponible relacionada con el cáncer. A partir de ahí, diseñó \"una nueva forma de vida\" basada en la potenciación de las capacidades del cuerpo y de la mente, y beneficiosa tanto para prevenir la aparición de esta enfermedad como para impedir su avance, sin prescindir de la medicina tradicional.</p> <p>Su propuesta es que todos deberíamos crear una \"biología anticáncer\", mediante una alimentación adecuada, ejercicio físico y bienestar psicológico, que refuerce las defensas naturales y nos permita afrontar esta enfermedad con éxito.</p>','','',NULL,21.10577,21.95,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,18.99038,'',1,0,0,0,'00363',0,NULL,0,NULL,0,0),(364,'LIBGARB0010',1,NULL,'2012-04-17 10:30:15','2018-05-14 16:28:34',0,0,'Libro La alimentacion como medicina','<p>Los alimentos fueron la primera medicina de la humanidad y hoy, a pesar de todos los avances científicos, siguen siendo la mejor. El doctor Dharma Singh Khalsa, una de las voces más autorizadas en el campo de la medicina integradora, nos explica de forma clara y accesible de qué modo comer bien puede producir extraordinarios beneficios para nuestro cuerpo, nuestra mente y nuestro espíritu. El programa que nos porpone el Dr. Khalsa ha demostrado ya su eficacia ante problemas como la hipertensión o el insomnio, o incluso para paliar dolencias graves como el cáncer, el Alzheimer o la Hepatitis C. Un programa que combina la eficacia de los alimentos con las terapias más avanzadas.</p>','','',NULL,8.65385,9,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,7.98077,'',1,0,1,0,'00364',0,NULL,0,NULL,0,0),(365,'MMACORT0011',1,NULL,'2012-04-17 10:30:15','2019-02-25 17:05:11',0,0,'Mermelada Naranja Dulce Azucar de Caña-Valle del Taibilla- 330g','<p>Estas mermeladas son de unos productores del Narpio que está en el Valle del Taibilla, en Albacete cerca de Murcia. Están hechas con azucar de caña y zumo de limón.</p>','','',NULL,2.81818,3.1,0,0,'TTC',10,0,1.4,0,1,1,1,0,'',NULL,'8437002491048',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,2.50909,'',1,0,1,1,'00365',0,NULL,0,NULL,0,0),(366,'PESNATU0001',1,NULL,'2012-04-17 10:30:16','2018-05-14 16:28:34',0,0,'Trucha entera- Naturix- unidad 250-300 gr- precio ud','<p>Envasada al Vacío</p>','','',NULL,2.68601121,2.95,0,0,'TTC',10,0,1,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,1.71714,'',1,0,0,0,'00366',0,NULL,0,NULL,0,0),(367,'PESNATU0002',1,NULL,'2012-04-17 10:30:16','2018-05-14 16:28:34',0,0,'Trucha eviscerada-Naturix-2 unid 550 gr. aprox.-precio 500 gr','Trucha eviscerada envasada (2 unidades por bolsa) con un peso aproximado de medio kilo','','',NULL,8.40909,9.25,0,0,'TTC',10,0,0,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,1.95466,'',1,0,0,0,'00367',0,NULL,0,NULL,0,0),(368,'PESNATU0003',1,NULL,'2012-04-17 10:30:17','2018-05-14 16:28:34',0,0,'Lubina entera-Naturix-400 g aprox-precio 500 gr','Lubina entera en bolsa, una unidad por bolsa,  peso 400 g aprox','','',NULL,11.27273,12.4,0,0,'TTC',10,0,0,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0.5,0,NULL,0,NULL,0,NULL,0,8.5063,'',1,0,0,0,'00368',0,NULL,0,NULL,0,0),(369,'PESNATU0004',1,NULL,'2012-04-17 10:30:17','2018-05-14 16:28:34',0,0,'Lubina eviscerada-Naturix-350 g aprox-precio  500 gr','Lubina eviscerada envasada-bolsa con 1 unidad-peso 350 gr aprox','','',NULL,1