te 7gr','<p>Muy aromático y de sabor ligeramente amargo es el ingrediente imprescindible de la cocina italiana, donde es utilizado para la salsa de tomate, las verduras fritas y la carne a la brasa y, por supuesto, la pizza.</p>','','',NULL,1.81818,2,0,0,'TTC',10,0,0,0,1,1,1,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,1.55782,'',1,0,1,1,'00386',0,NULL,0,NULL,0,10),(387,'ESPHERB0010',1,NULL,'2012-04-17 10:30:25','2019-01-09 15:47:22',0,0,'Perejil- Herbes del molí- bote 8gr','<p>USOS CULINARIOS</p><br />\r\n<p>Utilizado en la antigüedad como planta medicinal, su uso actual más difundido es el culinario, aunque no menos antiguo. Podría servir para sazonar prácticamente todos los alimentos, ya sean carnes, pescados, etc... De agradable color verde, sabor ligeramente picante.</p>','','',NULL,1.81818,2,0,0,'TTC',10,0,0,0,1,1,1,0,'',NULL,'8428201320093',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,1.47199,'',1,0,1,1,'00387',0,NULL,0,NULL,0,4),(388,'ESPHERB0013',1,NULL,'2012-04-17 10:30:25','2019-02-22 12:33:43',0,0,'Pimenton dulce- Herbes del molí- bote 38gr','<p>Uno de los principales usos en la cocina española es la elaboración de conservas, principalmente embutidos; tales como las sobrasadas, las chistorras, los chorizos (algunos de ellos procedentes de la matanza folclórica del cerdo), el lomo adobado o el morcón; y escabeches, típicamente los mejillones pero también pollo, sardinas, caballa, etc.</p>','','',NULL,2,2.2,0,0,'TTC',10,0,0,0,1,0,0,0,'',NULL,'8428201320017',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,1.83333,'',1,0,1,1,'00388',0,NULL,0,NULL,0,0),(389,'CEIHERB0009',1,NULL,'2012-04-17 10:30:26','2019-02-10 18:46:36',0,0,'Menta poleo- Herbes del molí- 20 saquitos','<p>La menta ya era conocida y apreciada en la antigüedad, siendo los romanos quienes extendieron su cultivo por toda Europa. La que tomamos actualmente es un híbrido descubierto casualmente en Inglaterra en un cultivo de hierbabuena y que ahora se cultiva en todo el mundo. Se consume por sus propiedades