4545,3.46,0,0,'TTC',10,0,1.4,0,1,1,1,0,'',NULL,'8428201100114',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,2.06619,'',1,0,1,1,'00392',0,NULL,0,NULL,0,6),(393,'ESPHERB0019',1,NULL,'2012-04-17 10:33:43','2019-02-15 13:25:55',0,0,'Harpagofito- Herbes del molí- bolsa raices (100gr)','<p>Propiedades Terapéuticas:</p><br />\r\n<p>El Harpagofito ejerce una acción principal Antiinflamatorio, Analgésico (que combate o quita el dolor), estimulante del Apetito y Colérica, es eficaz en el tratamiento sintomático de manifestaciones articulares dolorosas menores.</p>','','',NULL,4.18182,4.6,0,0,'TTC',10,0,0,0,1,1,1,0,'',NULL,'8428201100916',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,2.4607,'',1,0,1,1,'00393',0,NULL,0,NULL,0,7),(394,'ESPHERB0020',1,NULL,'2012-04-17 10:33:43','2018-11-30 12:36:00',0,0,'Hinojo- Herbes del molí- bolsa semillas (90gr)','<p>Las semillas de hinojo tienen un efecto espasmolítico de la mucosa lisa y analgésico en caso de cólicos.</p><br />\r\n<p>Son muy recomendables las tisanas a base de hinojo tanto contra la diarrea como el estreñimiento, en las enfermedades del aparato urinario y como tratamiento complementario de la diabetes. También se emplea en medicina veterinaria.</p>','','',NULL,2.36364,2.6,0,0,'TTC',10,0,1.4,0,1,1,1,0,'',NULL,'8428201101029',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,1.81976,'',1,0,1,1,'00394',0,NULL,0,NULL,0,0),(395,'ESPHERB0021',1,NULL,'2012-04-17 10:33:43','2018-11-02 10:15:58',0,0,'Hierba buena- Herbes del molí- bolsa hojas (20gr)','<p>La planta de hierbabuena, también conocida como menta verde, cuyo nombre científico es Mentha spicata, tiene varias propiedades medicinales. Entre ellas se destacan las antiespasmódicas, activando la producción de bilis por parte de la vesícula biliar y las carminativas, ya que actúa como estimulante de la eliminación de gases del tubo digestivo.</p>','','',NULL,1.39091,1.53,0,0,'TTC',10,0,1.4,0,1,1,1,0,'',NULL,'8428201100961',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,0,'',1,0,1,0,'00395',0,NULL,0,NULL,0,6),(396,'ESPHERB0022',1,NULL,'2012-04-17 10:33:44','2018-05-14 16:28:34',0,0,'Mejorana- Herbes del molí- bolsa flor/hojas (30gr)','<p>Se utiliza en la cocina, como especia, para la elaboración de embutidos y para preparar guisos. La mejorana presenta bellas flores en forma de cáliz. Las partes que se recolectan son las sumidades floridas, que tomadas en infusión, se utilizan para combatir toda suerte de trastornos.</p>','','',NULL,1.59091,1.75,0,0,'TTC',10,0,1.4,0,1,1,1,0,'',NULL,'8428201101272',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,1.06016,'',1,0,1,1,'00396',0,NULL,0,NULL,0,9),(397,'ESPHERB0023',1,NULL,'2012-04-17 10:33:44','2019-02-25 17:05:11',0,0,'Regaliz- Herbes del molí- bolsa raices (90gr)','<p>El regaliz, también conocido como palo dulce, cuyo nombre científico es Glycyrrhiza glabra, es una planta conocida en varias partes del mundo ya que posee varias propiedades medicinales. El regaliz posee propiedades medicinales de antiespasmódico, digestivo y antiácido.</p>','','',NULL,2.45455,2.7,0,0,'TTC',10,0,0,0,1,1,1,0,'',NULL,'8428201101562',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,1.49044,'',1,0,1,1,'00397',0,NULL,0,NULL,0,10),(398,'LIBGARB0007',1,NULL,'2012-04-17 10:33:45','2018-05-14 16:28:34',0,0,'Libro El horticultor autosuficiente','<p>John Seymour Ed. Blume, 256 páginas. Una información concisa pero tan completa y precisa como en las mejores enciclopedias, en un formato excepcionalmente manejable.</p>','','',NULL,19.18269,19.95,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,'2672786779869',2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,14.38462,'',1,0,0,0,'00398',0,NULL,0,NULL,0,0),(399,'LIBGARB0009',1,NULL,'2012-04-17 10:33:45','2018-05-14 16:28:34',0,0,'Libro Plantas medicinales','<p>Wolfgang Hensel Ed. Omega, 256 páginas. Guía de identificación de más de 350 especies de plantas medicinales de toda Europa.</p>','','',NULL,21.15385,22,0,0,'TTC',4,0,0.5,0,1,0,0,0,'',NULL,NULL,2,'','',NULL,0,0,NULL,0,NULL,0,NULL,0,15.86538,'',1,0,1,0,'00399',0,NULL,0,NULL,0,0),(400,'LIBGARB0013',1,NULL,