n\r\nPreparela con arroz, rebozada y freída/frita en sortijas, o siguiendo recetas tradicionales, en las que la cabeza bien picadita, junto con cebolla y jamón, se utiliza para hacer un guiso de choupa rellena, al estilo \"de los de antes\".','','',NULL,10.81818,11.9,0,0,'TTC',10,0,0,0,14,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,6.36364,'',1,0,0,0,'01883',0,NULL,0,NULL,0,NULL),(1884,'PESCANT0013',1,NULL,'2014-07-21 18:41:50','2018-05-14 16:28:34',0,0,'Jurel grande- O Canto da Balea- precio/kg','','','',NULL,12.13636,13.35,0,0,'TTC',10,0,0,0,14,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,7.27273,'',1,0,0,0,'01884',0,NULL,0,NULL,0,NULL),(1885,'PESCANT0003',1,NULL,'2014-07-21 18:45:11','2018-05-14 16:28:34',0,0,'Pescadilla-O Canto da Balea-precio/kg','','','',NULL,14.77273,16.25,0,0,'TTC',10,0,0,0,14,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,9.09091,'',1,0,0,0,'01885',0,NULL,0,NULL,0,NULL),(1886,'PESCANT0001',1,NULL,'2014-07-21 18:52:49','2018-05-14 16:28:34',0,0,'Faneca-O Canto da Balea-precio/kg','Faneca (Trisopterus luscus) es un pez de la familia Gadidae, a la que pertenecen también el bacalao (Gadus morhua). Se puede encontrar a lo largo de la costa europea.','','',NULL,13.45455,14.8,0,0,'TTC',10,0,0,0,14,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,8.18182,'',1,0,0,0,'01886',0,NULL,0,NULL,0,NULL),(1887,'PESCANT0021',1,NULL,'2014-07-21 18:58:57','2018-05-14 16:28:34',0,0,'Sargo mediano-O Canto da Balea- precio/kg','Pescado azul procedente de las costas Gallegas.\r\nFORMA DE COCINAR:\r\nEs delicioso al horno sin disfrazar mucho su sabor condimentándolo, pero también se consume frito, a la plancha o a la brasa.','','',NULL,18.72727,20.6,0,0,'TTC',10,0,0,0,14,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,11.81818,'',1,0,0,0,'01887',0,NULL,0,NULL,0,NULL),(1888,'PESCANT0008',1,NULL,'2014-07-21 19:53:36','2018-05-14 16:28:34',0,0,'Pulpo fresco mediano-O Canto da Balea-precio/kg','','','',N