ULL,0,NULL,0,NULL),(1907,'PESCANT0015',1,NULL,'2014-07-25 17:06:16','2018-05-14 16:28:34',0,0,'Lubina-O Canto da Balea-precio/kg','','','',NULL,37.04545,40.75,0,0,'TTC',10,0,0,0,14,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,24.54545,'',1,0,0,0,'01907',0,NULL,0,NULL,0,NULL),(1908,'PESCANT0016',1,NULL,'2014-07-25 17:08:50','2018-05-14 16:28:34',0,0,'Cabracho-O Canto da Balea-precio/kg','El cabracho es un pez de la famila de los escorpénidos de color rojo y cubierto de espinas. Su peso puede llegar hasta casi los 3 kg pero son raros los ejemplares de más de 1,5-2 kg.\r\n\r\nNormalmente se encuentra a profundidades desde los 10 a los 500 m, aunque es posible encontrarlos a poca agua. Durante el día permanecen aletargados en grietas rocosas, y por la noche salen de sus escondrijos para buscar comida, se quedan inmóviles y gracias a su camuflaje consiguen capturar pequeños peces y crustáceos. Su piel se cubre de algas mudándola aproximadamente cada dos semanas.\r\n\r\nCulinariamente es un pez muy valorado de altísima calidad. Se utiliza en Cataluña para cocerlo con patatas y se le conoce con el nombre de \"suquet de peix\". Es común hacer un pastel de ese pez, conocido como \"Pastel de Cabracho\"','','',NULL,19.90909,21.9,0,0,'TTC',10,0,0,0,14,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,12.72727,'',1,0,0,0,'01908',0,NULL,0,NULL,0,NULL),(1909,'PESCANT0018',1,NULL,'2014-07-25 17:11:42','2018-05-14 16:28:34',0,0,'Sepia-O Canto da Balea-precio/kg','','','',NULL,17.27273,19,0,0,'TTC',10,0,0,0,14,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,10.90909,'',1,0,0,0,'01909',0,NULL,0,NULL,0,NULL),(1910,'PESCANT0019',1,NULL,'2014-07-25 17:14:47','2018-05-14 16:28:34',0,0,'Cabrilla-O Canto da Balea-precio/kg','Serranus cabrilla\r\nTamaño: 20-30 cm\r\nProfundidad: 5- 30 m\r\nLongevidad: 4 años\r\nDescripción anatómica: Cuerpo fusiforme ligeramente comprimido lateralmente. Color muy variable, desde beige a anaranjado dependiendo del fondo y del estado de ánimo del pez. Línea longitudinal clara y líneas oblicuas en la parte lateral de la cabeza. Cabeza grande con la mandíbula inferior prominente. Pupila piriforme.','','',NULL,19.90909,21.9,0,0,'TTC',10,0,0,0,14,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,12.72727,'',1,0,0,0,'01910',0,NULL,0,NULL,0,NULL),(1911,'PESCANT0020',1,NULL,'2014-07-25 17:21:04','2018-05-14 16:28:34',0,0,'Sargo grande-O Canto da Balea-precio/kg','Pescado azul procedente de las costas Gallegas.\r\nFORMA DE COCINAR:\r\nEs delicioso al horno sin disfrazar mucho su sabor condimentándolo, pero también se consume frito, a la plancha o a la brasa.','','',NULL,22.68182,24.95,0,0,'TTC',10,0,0,0,14,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,14.54545,'',1,0,0,0,'01911',0,NULL,0,NULL,0,NULL),(1912,'PESCANT0022',1,NULL,'2014-07-25 17:23:06','2018-05-14 16:28:34',0,0,'Navaja-O Canto da Balea-precio/kg','Es un molusco bivalvo. Tienen una superficie brillante como si estuviera barnizada. Las valvas son alargadas y arqueadas, en forma de navaja. \r\nSe capturan, fundamentalmente, a buceo o sumergiéndose a pulmón. También con el sistema tradicional de echarles sal en el agujero. Están regulados por los Planes de Explotación Marisquera de Galicia y su carne es muy apreciada, sobre todo si se consume fresca, aunque también puede degustarse en conserva.','','',NULL,25.18182,27.7,0,0,'TTC',10,0,0,0,14,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,16.36364,'',1,0,0,0,'01912',0,NULL,0,NULL,0,NULL),(1913,'FRUGUAD0058',1,NULL,'2014-07-28 18:14:04','2019-01-02 12:16:10',0,0,'DESCATALOGADO Higos-Guadalhorce Ecológico - kilo','','','',NULL,4.13462,4.3,0,0,'TTC',4,0,0,0,11,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,2.5,'',1,0,0,0,'01913',0,NULL,0,NULL,0,NULL),(1914,'FRUFRUI0031',1,NULL,'2014-07-29 13:05:54','2019-01-25 18:17:28',0,0,'DESCATALOGADO Tomate Ensalada Tres Cantos-Fruitalpuntbio- precio kilo','','','',NULL,1.68269,1.75,0,0,'TTC',4,0,0,0