so cardíaco o de funcionamiento cerebral y personas con problemas inmunológicos. Cuenta cuando se toman antibióticos.\r\nNo recomendada para las embarazadas ni lactantes.\r\nUsos\r\nMalaria, 5 gr. por litro de agua por día durante 1 semana. Preventivo, 1 infusión al día.\r\nVIH, 3 infusiones diarias combinar con Moringa oleifera\r\nCultivo\r\nPlanta anual, cada año se ha de sembrar, plantar o hacer esquejes. Se puede consumir durante todo el cultivo pero tiene mas propiedades medicinales cuando comienza a florecer a finales de verano, se pueden hacer varios cortes durante el año o uno solo otoño.\r\nSe adapta a todo tipo de suelo, aunque los prefiere bien fértiles, quiere luz y riegos periódicos, puede hacer 3 metros de altura y 1 metro de ancho si se planta en mayo y la tierra le gusta.','','',NULL,3.18182,3.5,0,0,'TTC',10,0,0,0,40,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,2.55,'',NULL,0,0,0,'02924',0,NULL,NULL,NULL,0,NULL),(2925,'MHBPAM0036',1,NULL,'2016-04-12 11:44:13','2019-02-22 11:55:15',0,0,'Diente de león - Pamies Vitae - Planta viva','Propiedades \r\nDepurativa, digestiva, diurética, hepática, aperitiva, anemia, colagoga, colerética. \r\nContraindicaciones \r\nUlcera de estómago, piedras en la vesícula, cuando se toman antibióticos, embarazadas no mas como alimento. \r\nUsos \r\nEnsalada o 1,5-3 gr por infusión, 2-3 veces al día \r\nCultivo \r\nSe siembra en primavera o verano, se adapta a todo tipo de suelo y climas, especialmente los fríos. Se planta cada 30 cm. Es perenne.','','',NULL,2.27273,2.5,0,0,'TTC',10,0,0,0,40,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,1.82,'',NULL,0,0,0,'02925',0,NULL,NULL,NULL,0,NULL),(2926,'MHBPAM0037',1,NULL,'2016-04-12 11:51:35','2019-02-22 11:55:20',0,0,'Graviola - Pamies Vitae - Planta viva','','','',NULL,3.18182,3.5,0,0,'TTC',10,0,0,0,40,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,3,'',NULL,0,0,0,'02926',0,NULL,NULL,NULL,0,NULL),(2927,'MHBPAM0038',1,NULL,'2016-04-12 12:01:34','2019-02-22 11:56:36',0,0,'Kalanchoe Daigremontiana - Pamies Vitae - Planta viva','Propiedades\r\nAnalgésica, antialérgica, antihistamínica, antiinflamatoria, antitumoral, antiulcerosa, antibacteriana, antifúngica y antivírica, antitérmica, inmunosupresora (suprime algunas células del sistema inmune) inmunomoduladora (modula algunas células inmunes hiperactivas) relajante muscular, insecticida.\r\nContraindicaciones\r\nNo tomar en el embarazo, No utilizar en largos periodos si no se debe hacer ningún tratamiento, ni abusar de las dosis recomendadas (hasta 5 gr de planta x kilo de peso no hay toxicidad)\r\nEn caso de enfermedades cardíacas, consultar al médico (su composición incluye bufadienolidos, son glucósidos cardíacos que en dosis altas puede causar intoxicación). Las flores, son tóxicas.\r\nUsos\r\nHoja fresca, 30gr diarios, infusión hoja seca, 3gr, 3 veces al día.\r\nCultivo\r\nEs muy sensible al frío. Para poder hacerla más resistente al frío debemos tener todo el verano en la calle y en invierno aguantará -5 º C, normalmente -1 º C la puede matar, sobre todo si ha sido protegida en un invernadero o casa. La Kalanchoe daigremontiana tiene mucho hijos a las hojas, simplemente trasplantarlos. La Kalanchoe Pinnata y Gaston, se debe cortar una hoja y dejarla en el suelo, al cabo de un mes comenzarán a salir hijos con raíces de la hoja. Las kalanchoes son plantas que pueden captar el agua del aire, por lo tanto si no se regaran no morirían, claro que si se riegan se ponen muy guapas, normalmente regar una vez o dos a la semana. Algunas veces las kalanchoes florecen en invierno, si fuera así se hará planta nueva a través de esquejes. Puede durar de uno a varios años. Se plantan cada 60cm.','','',NULL,3.18182,3.5,0,0,'TTC',10,0,0,0,40,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,2.55,'',NULL,0,0,0,'02927',0,NULL,NULL,NULL,0,NULL),(2928,'MHBPAM0039',1,NULL,'2016-04-12 12:07:51','2019-02-22 11:56:42',0,0,'Perilla- Pamies Vitae - Planta viva','Propiedades\r\nAntiinflamatoria, antialérgica, resfriados, alteraciones respiratorias, digestivas, estimula el sistema inmunitario, antihistamínica, intoxicaciones alimentarias.\r\nContraindicaciones\r\nNo se han encontrado\r\nUsos\r\nSe come ensalada, 1,5gr-3gr por infusión.\r\nCultivo\r\nSe siembra y planta de primavera en verano, también se pueden hacer esquejes. Se adapta bien a climas fríos, pero hay que sembrar cuando terminan las heladas para tener tiempo suficiente para podas hacer hoja y semilla, con 5 meses ni suficiente. Puede hacer hasta 2 metros de altura. Planta anual pero si se deja hacer semilla, ésta cae al suelo y cada año nacerá espontáneamente. Se planta cada 60 cm.','','',NULL,3.18182,3.5,0,0,'TTC',10,0,0,0,40,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,2.55,'',NULL,0,0,0,'02928',0,NULL,NULL,NULL,0,NULL),(2929,'FRUEDEM0028',1,NULL,'2016-04-12 13:05:04','2019-01-01 10:44:49',0,0,'DESCATALOGADO Manzana Golden - Edemur - Kg','','','',NULL,1.44231,1.5,0,0,'TTC',4,0,0,0,42,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,2.15,'',NULL,0,0,0,'02929',0,NULL,NULL,NULL,0,NULL),(2930,'CPMPAND0028',1,NULL,'2016-04-12 13:30:47','2019-02-25 11:22:36',0,0,'Lomos de atún claro en su propio jugo - Pandomar - 220gr','','','',NULL,5.40909,5.95,0,0,'TTC',10,0,0,0,40,1,1,0,'',NULL,'8412439286740',2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,3.96,'',NULL,0,1,1,'02930',0,NULL,NULL,NULL,0,9),(2931,'CPMPAND0029',1,NULL,'2016-04-12 13:35:23','2019-02-25 11:22:36',0,0,'Filete de caballa en aceite de oliva - Pandomar - 220 gr','','','',NULL,5.22727,5.75,0,0,'TTC',10,0,0,0,40,1,1,0,'',NULL,'8412439286726',2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,3.82343,'',NULL,0,1,1,'02931',0,NULL,NULL,NULL,0,7),(2932,'CPMPAND0030',1,NULL,'2016-04-12 13:37:28','2019-02-25 17:05:11',0,0,'Sardinas fritas en aceite de oliva - Pandomar - 220gr','','','',NULL,4.86364,5.35,0,0,'TTC',10,0,0,0,40,1,1,0,'',NULL,'8412439286733',2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,3.74868,'',N