edul tiene propiedades antiinflamatorias y lipolíticas, remueven la grasa localizada y ayuda a su eliminación.\r\n\r\nEnebro, el aceite esencial de enebro estimula el sistema circulatorio, favorece la eliminación de tóxinas y está indicado para tratar la celulitis y la retención de líquidos.\r\n\r\n\r\nIngredientes: Helianthus annuus sunflower (pepita de girasol) seed oil*, Betula alba (abedul) leaf extract* (Olea europea (oliva) fruit oil*), Sesamun indicum (sésamo) seed oil*, Prunus amygdalus (almendras) dulcis oil*, Limonene**, Citrus sinensis peel (naranja dulce) oil expressed, Citrus limon (limón) peel oil*, Citrus paradisi M. (pomelo) peel oil expressed, Juniperus communis (enebro) branch/leaf/fruit extract*, Cedrus atlantica (cedro) wood oil*, Rosmarinus officinalis (romero) leaf oil* Linalool**, Citral**, Geraniol**,  *ingrediente ecológico certificado, **presente de forma natural en los aceites esenciales','','',NULL,18.76033,22.7,0,0,'TTC',21,0,0,0,40,1,1,0,'',NULL,'8412035478402',2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,12.95,'',NULL,0,1,1,'03107',0,NULL,NULL,NULL,0,2),(3108,'HORGUME0048',1,NULL,'2016-09-05 13:11:08','2019-01-27 13:07:09',0,0,'DESCATALOGADO Tomate FEO - GUMENDI - Kilo','','','',NULL,2.98077,3.1,0,0,'TTC',4,0,0,0,42,0,0,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,2,'',NULL,0,0,0,'03108',0,NULL,NULL,NULL,0,NULL),(3109,'FRUPIDE0017',1,NULL,'2016-09-05 13:18:39','2018-07-09 14:05:43',0,0,'Ciruela Amarilla - Pidebio - Kilo','','','',NULL,2.83654,2.95,0,0,'TTC',4,0,0,0,42,0,0,0,'',NULL,'9903109000000',2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,1.95,'',NULL,0,0,0,'03109',1,NULL,NULL,NULL,0,NULL),(3110,'DTOGARB00322',1,NULL,'2016-09-06 11:05:07','2018-05-14 16:28:34',0,0,'Descuento Agosto 2016 -aplicable Sep16-','','','',NULL,-1,-1,-100,-100,'TTC',0,0,0,0,5,1,1,0,'',NULL,NULL,2,'','',NULL,NULL,0,NULL,0,NULL,0,NULL,0,0,'',NULL,0,0,0,'03110',0,NULL,NULL,NULL,0,NULL),(3111,'HARRINC0018',1,NULL,'2016-09-08 12:25:18','2019-02-25 17:05:11',0,